import React from "react";





const AddFormPost = () => {

  const  [ name, setName ] = React.useState('');
  const [ price, setPrice ] = React.useState('');
  const  [ description, setDescription ] = React.useState('');
  const [ user, setUser ] = React.useState('');
  const [ adress, setAdress ] = React.useState('');
  const [ ville, setVille ] = React.useState('');







  return (
    <div>
      <h1>Add Form Post</h1>
      <form>
        <div className="form-group">
          <label htmlFor="name">Name</label>
          <input type="text" className="form-control" id="name" placeholder="Enter name" value={name} onChange={(e) => setName(e.target.value)} />
          <br />
          <label htmlFor="price">Price</label>
          <input type="text" className="form-control" id="price" placeholder="Enter price" value={price} onChange={(e) => setPrice(e.target.value)} />
          <br />
          <label htmlFor="description">Description</label>
          <input type="text" className="form-control" id="description" placeholder="Enter description" value={description} onChange={(e) => setDescription(e.target.value)} />
          <br />
          <label htmlFor="user">User</label>
          <input type="text" className="form-control" id="user" placeholder="Enter user" value={user} onChange={(e) => setUser(e.target.value)} />
          <br />
          <label htmlFor="adress">Adress</label>
          <input type="text" className="form-control" id="adress" placeholder="Enter adress" value={adress} onChange={(e) => setAdress(e.target.value)} />
          <br />
          <label htmlFor="ville">Ville</label>
          <input type="text" className="form-control" id="ville" placeholder="Enter ville" value={ville} onChange={(e) => setVille(e.target.value)} />
          <br />
          <button type="submit" className="btn btn-primary">Submit</button>
          </div>
          </form>
    </div>

  );
};

export default AddFormPost;
